import {MDBContainer} from 'mdbreact';
import React from 'react';
import {Line} from 'react-chartjs-2';


export type LineChartVProps = {
  lineChartData:any;

}


const LineChartV = (props:LineChartVProps) => {
  return (
    <MDBContainer>
      <h3 >{props?.lineChartData?.title}</h3>
      {props?.lineChartData ? <Line height={props?.lineChartData?.height}  data={props?.lineChartData} options={{responsive: true}} /> : null }


    </MDBContainer>
  );
};

export default LineChartV;
